    if y < 0.001:
        return x
    else:
        return gcd(y, fmod(x, y))

def calculate_smallest_arena_area(p1, p2, p3):
    (x1, y1) = p1
    (x2, y2) = p2
    (x3, y3) = p3
    a = hypot(x1 - x2, y1 - y2)
    b = hypot(x1 - x3, y1 - y3)
    c = hypot(x2 - x3, y2 - y3)
    A = acos((b * b + c * c - a * a) / (2 * b * c))
    B = acos((c * c - a * a - b * b) / (2 * c * a))
    C = acos((a * a + b * b - c * c) / (2 * a * b))
    R = a / (2 * sin(A))
    u = 2 * gcd(A, gcd(B, C))
    return round(R * R * pi / u * sin(u), 7)

